class Data extends Component {

  render() {
    const { perso:{ email, age, name , load }} = this.props;


    return (
      <div>
        {load ? 'carregando...' 
        : 
          <><p>{name}</p><p>{email}</p><p>{age}</p></>
      }
      </div>
    )
  }
}

export default Data
